r infection during treatment. Manage toxicity with TAVALISSE interruption, reduction, or discontinuation.</li>\r\n	<li>TAVALISSE can cause fetal harm when administered to pregnant women. Advise pregnant women the potential risk to a fetus. Advise females of reproductive potential to use effective contraception during treatment and for at least 1 month after the last dose. Verify pregnancy status prior to initiating TAVALISSE. It is unknown if TAVALISSE or its metabolite is present in human milk. Because of the potential for serious adverse reactions in a breastfed child, advise a lactating woman not to breastfeed during TAVALISSE treatment and for at least&nbsp;1 month&nbsp;after the last dose.</li>\r\n</ul>\r\n\r\n<h3>Drug Interactions</h3>\r\n\r\n<ul>\r\n	<li>Concomitant use of TAVALISSE with strong CYP3A4 inhibitors increases exposure to the major active metabolite of TAVALISSE (R406), which may increase the risk of adverse reactions. Monitor for toxicities that may require a reduction in TAVALISSE dose.</li>\r\n	<li>It is not recommended to use TAVALISSE with strong CYP3A4 inducers, as concomitant use reduces exposure to R406.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of some CYP3A4 substrate drugs and may require a dose reduction of the CYP3A4 substrate drug.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of BCRP substrate drugs (eg, rosuvastatin) and P-Glycoprotein (P-gp) substrate drugs (eg, digoxin), which may require a dose reduction of the BCRP and P-gp substrate drug.</li>\r\n</ul>\r\n\r\n<h3>Adverse Reactions</h3>\r\n\r\n<ul>\r\n	<li>Serious adverse drug reactions in the ITP double-blind studies were febrile neutropenia, diarrhea, pneumonia, and hypertensive crisis, which occurred in 1% of TAVALISSE patients. In addition, severe adverse reactions occurred including dyspnea and hypertension (both 2%), neutropenia, arthralgia, chest pain, diarrhea, dizziness, nephrolithiasis, pain in extremity, toothache, 