INSERT INTO `block_content_revision__field_fixed_isi` VALUES ('important_safety_information_isi',0,10,43,'en',0,'<h2>INDICATION</h2>\r\n\r\n<p>TAVALISSE is indicated for the treatment of thrombocytopenia in adult patients with chronic immune thrombocytopenia (ITP) who have had an insufficient response to a previous&nbsp;treatment.</p>\r\n\r\n<h2>IMPORTANT SAFETY INFORMATION</h2>\r\n\r\n<h3>Warnings and Precautions</h3>\r\n\r\n<ul>\r\n	<li>Hypertension can occur with TAVALISSE treatment. Patients with pre-existing hypertension may be more susceptible to the hypertensive effects. Monitor blood pressure every&nbsp;2 weeks&nbsp;until stable, then monthly, and adjust or initiate antihypertensive therapy for blood pressure control maintenance during therapy. If increased blood pressure persists, TAVALISSE interruption, reduction, or discontinuation may be required.</li>\r\n	<li>Elevated liver function tests (LFTs), mainly ALT and AST, can occur with TAVALISSE. Monitor LFTs monthly during treatment. If ALT or AST increase to &gt;3 x upper limit of normal, manage hepatotoxicity using TAVALISSE interruption, reduction, or discontinuation.</li>\r\n	<li>Diarrhea occurred in 31% of patients and severe diarrhea occurred in 1% of patients treated with TAVALISSE. Monitor patients for the development of diarrhea and manage using supportive care measures early after the onset of symptoms. If diarrhea becomes severe (≥Grade 3), interrupt, reduce dose or discontinue TAVALISSE.</li>\r\n	<li>Neutropenia occurred in 6% of patients treated with TAVALISSE; febrile neutropenia occurred in 1% of patients. Monitor the ANC monthly and for infection during treatment. Manage toxicity with TAVALISSE interruption, reduction, or discontinuation.</li>\r\n	<li>TAVALISSE can cause fetal harm when administered to pregnant women. Advise pregnant women the potential risk to a fetus. Advise females of reproductive potential to use effective contraception during treatment and for at least 1 month after the last dose. Verify pregnancy status prior to initiating TAVALISSE. It is unknown if TAVALISSE or its metabolite is present in human milk. Because of the potential for serious adverse reactions in a breastfed child, advise a lactating woman not to breastfeed during TAVALISSE treatment and for at least&nbsp;1 month&nbsp;after the last dose.</li>\r\n</ul>\r\n\r\n<h3>Drug Interactions</h3>\r\n\r\n<ul>\r\n	<li>Concomitant use of TAVALISSE with strong CYP3A4 inhibitors increases exposure to the major active metabolite of TAVALISSE (R406), which may increase the risk of adverse reactions. Monitor for toxicities that may require a reduction in TAVALISSE dose.</li>\r\n	<li>It is not recommended to use TAVALISSE with strong CYP3A4 inducers, as concomitant use reduces exposure to R406.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of some CYP3A4 substrate drugs and may require a dose reduction of the CYP3A4 substrate drug.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of BCRP substrate drugs (eg, rosuvastatin) and P-Glycoprotein (P-gp) substrate drugs (eg, digoxin), which may require a dose reduction of the BCRP and P-gp substrate drug.</li>\r\n</ul>\r\n\r\n<h3>Adverse Reactions</h3>\r\n\r\n<ul>\r\n	<li>Serious adverse drug reactions in the ITP double-blind studies were febrile neutropenia, diarrhea, pneumonia, and hypertensive crisis, which occurred in 1% of TAVALISSE patients. In addition, severe adverse reactions occurred including dyspnea and hypertension (both 2%), neutropenia, arthralgia, chest pain, diarrhea, dizziness, nephrolithiasis, pain in extremity, toothache, syncope, and hypoxia (all 1%).</li>\r\n	<li>Common adverse reactions (≥5% and more common than placebo) from FIT-1 and FIT-2 included: diarrhea, hypertension, nausea, dizziness, ALT and AST increased, respiratory infection, rash, abdominal pain, fatigue, chest pain, and neutropenia.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Please see&nbsp;<a href=\"https://tavalissehcp.com/downloads/pdf/TAVALISSE-Full-Prescribing-Information.pdf\" target=\"_blank\">full Prescribing Information</a>.</strong></p>\r\n\r\n<p><strong>To report side effects of prescription drugs to the FDA, visit&nbsp;<a href=\"http://www.fda.gov/medwatch\" target=\"_blank\">www.fda.gov/medwatch</a>&nbsp;or call&nbsp;<a href=\"tel:+18003321088\">1-800-FDA-1088 (1-800-332-1088)</a>.</strong></p>\r\n','full_html'),('important_safety_information_isi',0,10,44,'en',0,'<h3>INDICATION</h3>\r\n\r\n<p>TAVALISSE is indicated for the treatment of thrombocytopenia in adult patients with chronic immune thrombocytopenia (ITP) who have had an insufficient response to a previous&nbsp;treatment.</p>\r\n\r\n<h3>IMPORTANT SAFETY INFORMATION</h3>\r\n\r\n<h3>Warnings and Precautions</h3>\r\n\r\n<ul>\r\n	<li>Hypertension can occur with TAVALISSE treatment. Patients with pre-existing hypertension may be more susceptible to the hypertensive effects. Monitor blood pressure every&nbsp;2 weeks&nbsp;until stable, then monthly, and adjust or initiate antihypertensive therapy for blood pressure control maintenance during therapy. If increased blood pressure persists, TAVALISSE interruption, reduction, or discontinuation may be required.</li>\r\n	<li>Elevated liver function tests (LFTs), mainly ALT and AST, can occur with TAVALISSE. Monitor LFTs monthly during treatment. If ALT or AST increase to &gt;3 x upper limit of normal, manage hepatotoxicity using TAVALISSE interruption, reduction, or discontinuation.</li>\r\n	<li>Diarrhea occurred in 31% of patients and severe diarrhea occurred in 1% of patients treated with TAVALISSE. Monitor patients for the development of diarrhea and manage using supportive care measures early after the onset of symptoms. If diarrhea becomes severe (≥Grade 3), interrupt, reduce dose or discontinue TAVALISSE.</li>\r\n	<li>Neutropenia occurred in 6% of patients treated with TAVALISSE; febrile neutropenia occurred in 1% of patients. Monitor the ANC monthly and for infection during treatment. Manage toxicity with TAVALISSE interruption, reduction, or discontinuation.</li>\r\n	<li>TAVALISSE can cause fetal harm when administered to pregnant women. Advise pregnant women the potential risk to a fetus. Advise females of reproductive potential to use effective contraception during treatment and for at least 1 month after the last dose. Verify pregnancy status prior to initiating TAVALISSE. It is unknown if TAVALISSE or its metabolite is present in human milk. Because of the potential for serious adverse reactions in a breastfed child, advise a lactating woman not to breastfeed during TAVALISSE treatment and for at least&nbsp;1 month&nbsp;after the last dose.</li>\r\n</ul>\r\n\r\n<h3>Drug Interactions</h3>\r\n\r\n<ul>\r\n	<li>Concomitant use of TAVALISSE with strong CYP3A4 inhibitors increases exposure to the major active metabolite of TAVALISSE (R406), which may increase the risk of adverse reactions. Monitor for toxicities that may require a reduction in TAVALISSE dose.</li>\r\n	<li>It is not recommended to use TAVALISSE with strong CYP3A4 inducers, as concomitant use reduces exposure to R406.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of some CYP3A4 substrate drugs and may require a dose reduction of the CYP3A4 substrate drug.</li>\r\n	<li>Concomitant use of TAVALISSE may increase concentrations of BCRP substrate drugs (eg, rosuvastatin) and P-Glycoprotein (P-gp) substrate drugs (eg, digoxin), which may require a dose reduction of the BCRP and P-gp substrate drug.</li>\r\n</ul>\r\n\r\n<h3>Adverse Reactions</h3>\r\n\r\n<ul>\r\n	<li>Serious adverse drug reactions in the ITP double-blind studies were febrile neutropenia, diarrhea, pneumonia, and hypertensive crisis, which occurred in 1% of TAVALISSE patients. In addition, severe adverse reactions occurred including dyspnea and hypertension (both 2%), neutropenia, arthralgia, chest pain, diarrhea, dizziness, nephrolithiasis, pain in extremity, toothache, syncope, and hypoxia (all 1%).</li>\r\n	<li>Common adverse reactions (≥5% and more common than placebo) from FIT-1 and FIT-2 included: diarrhea, hypertension, nausea, dizziness, ALT and AST increased, respiratory infection, rash, abdominal pain, fatigue, chest pain, and neutropenia.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Please see&nbsp;<a href=\"https://tavalissehcp.com/downloads/pdf/TAVALISSE-Full-Prescribing-Information.pdf\" target=\"_blank\">full Prescribing Information</a>.</strong></p>\r\n\r\n<p><strong>To report side effects of prescription drugs to the FDA, visit&nbsp;<a href=\"http://www.fda.gov/medwatch\" target=\"_blank\">www.fda.gov/medwatch</a>&nbsp;or call&nbsp;<a href=\"tel:+18003321088\">1-800-FDA-1088 (1-800-332-1088)</a>.</strong></p>\r\n','full_html'),('important_safety_information_isi',0,10,83,'en',0,'<h3>INDICATION</h3>\r\n\r\n<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo.</p>\r\n\r\n<h3>IMPORTANT SAFETY INFORMATION</h3>\r\n\r\n<h3>Warnings and Precautions</h3>\r\n\r\n<ul>\r\n	<li>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo.</li>\r\n	<li>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo.</li>\r\n	<li>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo.</li>\r\n	<li>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, to