INSERT INTO `node_revision__body` VALUES ('page',1,2,40,'en',0,'<p>The alien mothership is in orbit here. If we can hit that bullseye, the rest of the dominoes will fall like a house of cards. Checkmate.</p>\r\n\r\n<p>Yes! In your face, Gandhi! And remember, don\'t do anything that affects anything, unless it turns out you were supposed to, in which case, for the love of God, don\'t not do it! Aww, it\'s true. I\'ve been hiding it for so long.</p>\r\n\r\n<p>Belligerent and numerous. I haven\'t felt much of anything since my guinea pig died.&nbsp;<strong>You\'re going to do his laundry?</strong>&nbsp;<em>I can explain.</em>&nbsp;It\'s very valuable.</p>\r\n\r\n<h2>Ask her how her day was.</h2>\r\n\r\n<p>Spare me your space age technobabble, Attila the Hun! That\'s not soon enough! You don\'t know how to do any of those. I usually try to keep my sadness pent up inside where it can fester quietly as a mental illness.</p>\r\n\r\n<ol>\r\n	<li>Say what?</li>\r\n	<li>And yet you haven\'t said what I told you to say! How can any of us trust you?</li>\r\n	<li>Yep, I remember. They came in last at the Olympics, then retired to promote alcoholic beverages!</li>\r\n</ol>\r\n\r\n<h3>It\'s toe-tappingly tragic!</h3>\r\n\r\n<p>Hey! I\'m a porno-dealing monster, what do I care what you think? I barely knew Philip, but as a clergyman I have no problem telling his most intimate friends all about him. As an interesting side note, as a head without a body, I envy the dead.</p>\r\n\r\n<ul>\r\n	<li>Guess again.</li>\r\n	<li>Eeeee! Now say \"nuclear wessels\"!</li>\r\n	<li>That\'s a popular name today. Little \"e\", big \"B\"?</li>\r\n</ul>\r\n\r\n<p>I never loved you. Bender?! You stole the atom. Negative, bossy meat creature! You\'re going back for the Countess, aren\'t you? One hundred dollars. Oh no! The professor will hit me! But if Zoidberg \'fixes\' it… then perhaps gifts!</p>\r\n\r\n<p>Shinier than yours, meatbag. Oh, I think we should just stay friends. I just want to talk. It has nothing to do with mating. Fry, that doesn\'t make sense. Now Fry, it\'s been a few years since medical school, so remind me. Disemboweling in your species: fatal or non-fatal?</p>\r\n\r\n<p>I guess because my parents keep telling me to be more ladylike. As though! There\'s one way and only one way to determine if an animal is intelligent. Dissect its brain! I haven\'t felt much of anything since my guinea pig died.</p>\r\n\r\n<p>How much did you make me? Then we\'ll go with that data file! You\'ll have all the Slurm you can drink when you\'re partying with Slurms McKenzie! Guess again. When I was first asked to make a film about my nephew, Hubert Farnsworth, I thought \"Why should I?\" Then later, Leela made the film. But if I did make it, you can bet there would have been more topless women on motorcycles. Roll film!</p>\r\n\r\n<p>I was having the most wonderful dream. Except you were there, and you were there, and you were there! Shinier than yours, meatbag. Shut up and take my money! This is the worst part. The calm before the battle.</p>\r\n\r\n<p>You can crush me but you can\'t crush my spirit! I feel like I was mauled by Jesus. When will that be? Bender, quit destroying the universe!</p>\r\n\r\n<p>That could be \'my\' beautiful soul sitting naked on a couch. If I could just learn to play this stupid thing. File not found. No! The kind with looting and maybe starting a few fires! This is the worst kind of discrimination: the kind against me!</p>\r\n\r\n<p>I\'ll tell them you went down prying the wedding ring off his cold, dead finger. No, just a regular mistake. For example, if you killed your grandfather, you\'d cease to exist! You\'re going to do his laundry?</p>\r\n\r\n<p>Please, Don-Bot… look into your hard drive, and open your mercy file! What kind of a father would I be if I said no? Fry, you can\'t just sit here in the dark listening to classical music. Ow, my spirit!</p>\r\n\r\n<p>All I want is to be a monkey of moderate intelligence who wears a suit… that\'s why I\'m transferring to business school! Bender?! You stole the atom. Kif, I have mated with a woman. Inform the men.</p>\r\n\r\n<p>When the lights go out, it\'s nobody\'s business what goes on between two consenting adults. You know the worst thing about being a slave? They make you work, but they don\'t pay you or let you go. Calculon is gonna kill us and it\'s all everybody else\'s fault!</p>\r\n','','full_html'),('page',1,2,46,'en',0,'<p>The alien mothership is in orbit here. If we can hit that bullseye, the rest of the dominoes will fall like a house of cards. Checkmate.</p>\r\n\r\n<p>Yes! In your face, Gandhi! And remember, don\'t do anything that affects anything, unless it turns out you were supposed to, in which case, for the love of God, don\'t not do it! Aww, it\'s true. I\'ve been hiding it for so long.</p>\r\n\r\n<p>Belligerent and numerous. I haven\'t felt much of anything since my guinea pig died.&nbsp;<strong>You\'re going to do his laundry?</strong>&nbsp;<em>I can explain.</em>&nbsp;It\'s very valuable.</p>\r\n\r\n<h2>Ask her how her day was.</h2>\r\n\r\n<p>Spare me your space age technobabble, Attila the Hun! That\'s not soon enough! You don\'t know how to do any of those. I usually try to keep my sadness pent up inside where it can fester quietly as a mental illness.</p>\r\n\r\n<ol>\r\n	<li>Say what?</li>\r\n	<li>And yet you haven\'t said what I told you to say! How can any of us trust you?</li>\r\n	<li>Yep, I remember. They came in last at the Olympics, then retired to promote alcoholic beverages!</li>\r\n</ol>\r\n\r\n<h3>It\'s toe-tappingly tragic!</h3>\r\n\r\n<p>Hey! I\'m a porno-dealing monster, what do I care what you think? I barely knew Philip, but as a clergyman I have no problem telling his most intimate friends all about him. As an interesting side note, as a head without a body, I envy the dead.</p>\r\n\r\n<ul>\r\n	<li>Guess again.</li>\r\n	<li>Eeeee! Now say \"nuclear wessels\"!</li>\r\n	<li>That\'s a popular name today. Lit